import React from "react";
import twitter from './images/grey-twitter-icon.png'
import facebook from './images/grey-facebook-icon.png'
import instagram from './images/grey-instagram-icon.png'
export default function Footer() {
    return (
        <footer>
            <img src="./images/grey-twitter-icon.png"></img>
            <img src="./images/grey-facebook-icon.png"></img>
            <img src="./images/grey-instagram-icon.png"></img>
            <img src="./images/grey-github-icon.png"></img>
        </footer>
    );
}
